import React, { useEffect, useState } from 'react'
import axios from 'axios'

export const Business_Content = () => {
    
    const [ Supporting_Businesses_Page , update_Page] = useState(0)
    
    const [ Supporting_Businesses , update_Business] = useState()
    const [ Supporting_Businesses_pageLoader , update_Loader] = useState()

    const Generating_Business_icon = (apidata) =>{
        return <React.Fragment>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+1].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+2].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+3].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+4].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+5].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+6].id}</li>
        <li className='Business_icon_Components'> {apidata.data.carts[Supporting_Businesses_Page+7].id}</li>
        </React.Fragment>
    }

    const Generating_Business_Page_Button = (apidata) => {

        const Change_Contents = (tab) => {
            axios.get('https://dummyjson.com/carts').then(
            (result)=>{

                const Value = Object.values(tab.target.parentNode.children)
                const Index = Value.indexOf(tab.target)

                console.log(Index)

                return Generating_Business_icon(result)

            }).then((result)=>{
                update_Business(result)
            })
        }

        return <React.Fragment>
            
            <div className='Business_icon_Container_Page_Button_Component' key={1} onClick={Change_Contents}>1</div>
            <div className='Business_icon_Container_Page_Button_Component' onClick={Change_Contents}>2</div>
            <div className='Business_icon_Container_Page_Button_Component' onClick={Change_Contents}>3</div>
        
        </React.Fragment>
    }

    useEffect(()=>{
        axios.get('https://dummyjson.com/carts').then(
            (result)=>{
        
            return [Generating_Business_icon(result), Generating_Business_Page_Button(result)]
            
            }).then((result)=>{
                update_Business(result[0])
                update_Loader(result[1])

            })
    },[])

    return(
        <React.Fragment>

        <div id='Three_instruction_Tab_Content_Support_Business_Part'>
            <div id='Business_icon_Container_Title'> Supporter Businesses </div>
            <div id='Business_icon_Container'>
                {Supporting_Businesses}
            </div>
            <div id='Business_icon_Container_Page_Manager'>
                {Supporting_Businesses_pageLoader}
            </div>
        </div>

        </React.Fragment>
    )
}

export default Business_Content
